    QString fullPath = QString(_serverConfigs["runApp"][_serverIndices.value("runApp")].URL()+"/apps/rules/run");
    
    if (_apiKeys.contains("Authorization")) {
        addHeaders("Authorization",_apiKeys.find("Authorization").value());
    }
    
